    const [value, onChange] = useState(new Date());
    console.log(value)
    return (
        <div className="Calendar-Page">
            <div> </div>
            <div>
                <Calendar onChange={onChange} value={value}/>
            </div>
        </div>
    );
};

export default Calendrier;
